using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace A1080_Image_Base64
{
    class Program
    {
        static void Main(string[] args)
        {

            string base64Str = "data:image/png;base64,";


            SaveBase64Image(base64Str, "test.jpg");

            Console.WriteLine("Finish!");
            Console.ReadKey();
        }



        static void SaveBase64Image(string base64Str, string outputFile)
        {
            base64Str = base64Str.Replace("data:image/png;base64,", "");

            byte[] bytes = Convert.FromBase64String(base64Str);

            using (System.IO.MemoryStream ms = new System.IO.MemoryStream(bytes))
            {
                System.Drawing.Image image = System.Drawing.Image.FromStream(ms);

                image.Save(outputFile, System.Drawing.Imaging.ImageFormat.Jpeg);
            }
        }


    }
}
